import React from 'react'

import CompletedPage from './CompletedPage'
import { useEffect } from 'react'
import Quiz from './Quiz'

const QuizPage = (props) => {

    
  
    useEffect(() => {
      console.log(props)
    },[])
    

  return (
    <div className='quiz-container'>
        <h2 className='question'>What frame does this move come out on?</h2>
        {props.isGameFinished ? <CompletedPage points={props.points}/> : <Quiz isGameFinished={props.isGameFinished} setIsGameFinished={props.setIsGameFinished} points={props.points} setPoints={props.setPoints}/>}
        
    </div>
  )
}

export default QuizPage
